import React from "react";
import { StyleSheet, View, Text, Image, TouchableHighlight } from "react-native";
import { Header, Left, Right, Icon } from "native-base";

export default (props) => {
    const { navigation } = props;
    return (
        <View style={styles.container}>
            <Image
                source={require("../../../../assets/slider_noticia_001.jpg")}
                style={{
                    width: null,
                    resizeMode: "contain",
                    height: 220,
                    marginBottom: 5,
                    marginTop: -15,
                    zIndex: -2,
                }}
            />
            <View style={styles.body}>
                <View style={styles.title}>
                    <Text style={styles.textTitle} >
                        Alcancia Digital
                    </Text>
                </View>
                <View style={styles.buttons}>
                    <TouchableHighlight onPress={() => navigation.navigate('Donacion Personas')} style={styles.buttonUser}><Text style={styles.textUsers}>Donación Personas</Text></TouchableHighlight>
                    <TouchableHighlight onPress={() => navigation.navigate('Donacion Empresas')} style={styles.buttonCompany}><Text style={styles.textCompany}>Donación Empresas</Text></TouchableHighlight>
                </View>
            </View>
        </View>
    );
};

const styles = StyleSheet.create({
    container: {
        flex: 5,
    },
    header: {
        backgroundColor: "#03255F",
        height: 60,
    },
    icon: {
        color: 'white',
    },
    body: {
        flex: 6,
        alignItems: "center",
        justifyContent: "center",
    },
    imageContainer: {
        flex: 3,
    },
    title: {
        flex: 1,
    },
    textTitle: {
        fontSize: 40,
        color: '#03255F',
        fontWeight: 'bold',
        paddingTop: 30,
    },
    buttons: {
        flex: 2,
        flexDirection: 'row',

    },
    buttonUser: {
        width: 100,
        height: 100,
        backgroundColor: '#03255F',
        alignItems: 'center',
        justifyContent: 'center',
        marginBottom: 10,
        marginRight: 5,
    },
    buttonCompany: {
        width: 100,
        height: 100,
        backgroundColor: '#F5C300',
        alignItems: 'center',
        justifyContent: 'center',
        marginBottom: 10,
        marginLeft: 5,


    },
    textUsers: {
        fontSize: 20,
        color: '#F5C300',
        fontWeight: 'bold',
        textAlign: 'center',
    },
    textCompany: {
        fontSize: 20,
        color: '#03255F',
        fontWeight: 'bold',
        textAlign: 'center',
    },
});
